Першасная арганізацыя прафсаюза студэнтаў установы адукацыі «Беларускі дзяржаўны медыцынскі універсітэт» аб'ядноўвае больш за 6000 чалавек.
забеспячэнне ўмоў захавання канстытуцыйных правоў і гарантый, сацыяльнай абароны, ахову здароўя навучэнцаў;
стварэнне бяспечных умоў навучання, побыту і эфектыўнай сістэмы аховы Я хочу забути אני לגמרי Препарат ішке тағайындалады, доза жұқпаның орналасуына және ауырлығына, сондай-ақ қоздырғыштың сезімталдығына қарай әркімге жеке
